import logo from './logo.svg';
import './App.css';
import EmailBlock from './EmailBlock';
import PassWordBlock from'./PassWordBlock';
function App() {
  return (
    <div classname="App">
      <div>
        {
          EmailBlock()
        }
        </div>
        <div>
          {
            PassWordBlock()
          }
        </div>
      </div>
  );
}

export default App;
